import React, {useMemo} from 'react'
import MaterialTable from 'material-table'
import MOCK_DATA from './MOCK_DATA.json'
import { COLUMNS } from './columns'

export const ImportTable = () => {
    const columns = [
  {
    name: "Title",
    selector: "title",
    sortable: true
  },
  {
    name: "Directior",
    selector: "director",
    sortable: true
  },
  {
    name: "Runtime (m)",
    selector: "runtime",
    sortable: true,
    right: true
  }
]; 
       
    return (
       <div>
            <MaterialTable 
            title={"Table"}
            columns={columns}
            
            />
        </div>
    )
}
